"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Chronic obstructive pulmonary disease (COPD), including emphysema (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/chronic-obstructive-pulmonary-disease-copd-including-emphysema-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H462190496\">",
"      <span class=\"h1\">",
"       What is COPD?",
"      </span>",
"      &nbsp;&mdash;&nbsp;COPD is a lung disease that makes it hard to breathe. In people with COPD, the airways (the branching tubes that carry air within the lungs) become narrow and damaged (",
"      <a class=\"graphic graphic_figure graphicRef67527 \" href=\"UTD.htm?40/17/41237\">",
"       figure 1",
"      </a>",
"      ). This makes people feel out of breath and tired.",
"     </p>",
"     <p>",
"      COPD can be a serious illness. It cannot be cured and it usually gets worse over time. But there are treatments that can help.",
"     </p>",
"     <p>",
"      You may have heard COPD referred to as &ldquo;chronic bronchitis&rdquo; or &ldquo;emphysema.&rdquo; These are types of COPD.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H462190503\">",
"      <span class=\"h1\">",
"       Why did I get COPD?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The most common cause of COPD is smoking. Smoke can damage the lungs forever and cause COPD. People can also get COPD from breathing in toxic fumes or gases.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H462190510\">",
"      <span class=\"h1\">",
"       What are the symptoms of COPD?",
"      </span>",
"      &nbsp;&mdash;&nbsp;At first, COPD often causes no symptoms. As it gets worse it can make you:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Feel short of breath, especially when you are moving around",
"       </li>",
"       <li>",
"        Wheeze (make a whistling or squeaking noise as you breathe)",
"       </li>",
"       <li>",
"        Cough and spit up phlegm (mucus)",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      People who have had COPD for a while are also at increased risk for:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Infections, such as pneumonia",
"       </li>",
"       <li>",
"        Lung cancer",
"       </li>",
"       <li>",
"        Heart problems",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H462190517\">",
"      <span class=\"h1\">",
"       Is there a test for COPD?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor or nurse can give you a test called spirometry to check for COPD. During spirometry, you take a deep breath and then blow out as fast and hard as you can into a tube. A machine connected to the tube measures how much air you can blow out of your lungs and how fast you can blow.",
"     </p>",
"     <p>",
"      If the results of your spirometry are NOT normal, your doctor or nurse will give you medicine in an inhaler. Then he or she will test you again. This will help the doctor or nurse find out if your problem is caused by COPD or another lung problem, such as asthma. People with asthma usually get normal results after they use an inhaler. People with COPD do not.",
"     </p>",
"     <p>",
"      <strong>",
"       STOP SMOKING!",
"      </strong>",
"      If you smoke, the most important thing you can do for your COPD is to stop smoking. It does not matter how long you have smoked or how much you smoke. Quitting will slow your disease and help you feel better.",
"     </p>",
"     <p>",
"      <strong>",
"       Get the flu shot every fall, and the pneumonia vaccine at least once.",
"      </strong>",
"      Infections like the flu and pneumonia can be very hard on your lungs. It's important to try to prevent them.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H462190538\">",
"      <span class=\"h1\">",
"       How is COPD treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There are 4 main types of treatment for COPD:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Medicines",
"        </strong>",
"        &ndash; There are a lot of medicines to treat COPD. Most people use inhalers that help open up their airways or that decrease swelling in the airways. Often people need more than one inhaler at a time. As the disease gets worse, some people need to use oxygen.",
"       </li>",
"       <li>",
"        <strong>",
"         Oxygen",
"        </strong>",
"        &ndash; As the disease gets worse, some people need to use oxygen.",
"       </li>",
"       <li>",
"        <strong>",
"         Pulmonary rehab",
"        </strong>",
"        &ndash; In pulmonary rehab, people learn to improve their symptoms in new ways. They learn exercises and ways to breathe that can help ease symptoms.",
"       </li>",
"       <li>",
"        <strong>",
"         Surgery",
"        </strong>",
"        &ndash; RARELY, people with severe COPD will have surgery to remove the most damaged parts of their lung. This surgery can reduce symptoms, but it does not always work.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H462190545\">",
"      <span class=\"h1\">",
"       More on this topic",
