var title_f4_59_5052="Diagnostic tests for PCD";
var content_f4_59_5052=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F77133&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F77133&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Diagnostic tests for primary ciliary dyskinesia (PCD)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Test",
"      </td>",
"      <td class=\"subtitle1\">",
"       Comments",
"      </td>",
"      <td class=\"subtitle1\">",
"       Disadvantages",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Nasal Nitric Oxide (nNO)",
"      </td>",
"      <td>",
"       Screening test mainly to exclude PCD. Easy to set up but relatively expensive equipment.",
"      </td>",
"      <td>",
"       False positive results are reported, while a false negative is extremely rare.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Saccharin test",
"      </td>",
"      <td>",
"       Screening test. Easy to set up.",
"      </td>",
"      <td>",
"       False positive as well as false negative results are quite common. As a screening test, quite time consuming.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Electron microscopy of nasal or bronchial biopsy",
"      </td>",
"      <td>",
"       Confirmation test. Somewhat painful. Requires experienced lab and interested pathologist.",
"      </td>",
"      <td>",
"       False negative in about 20 percent. Only available at special centers.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       High-speed video microscopy",
"      </td>",
"      <td>",
"       Confirmation test. Requires experienced lab.",
"      </td>",
"      <td>",
"       Seldom false negative. False positive results occur, so a positive test needs to be repeated.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Inhalation of colloid albumin tagged with 99Tc",
"      </td>",
"      <td>",
"       So far mainly a \"research tool\" but entering into clinical practice in a few centers. Could be a useful test in the future.",
"      </td>",
"      <td>",
"       Exposure to radiation. Indirect test measuring mucociliary clearance. A high specificity and sensitivity for PCD is reported but number of reports is still limited.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Cell culture of ciliated cells",
"      </td>",
"      <td>",
"       Confirmation test when other test-results are equivocal.",
"      </td>",
"      <td>",
"       Complicated, time consuming and available at few centers.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Sperm motility",
"      </td>",
"      <td>",
"       Additional test when other test-results are equivocal.",
"      </td>",
"      <td>",
"       False negative as well as false positive results are reported.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
