var title_f4_59_5053="Evaluation of comorbidities";
var content_f4_59_5053=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F61331&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F61331&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Evaluation of conditions that co-occur with asthma",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Diagnosis",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical features",
"       </td>",
"       <td class=\"subtitle1\">",
"        Testing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Allergic bronchopulmonary aspergillosis",
"       </td>",
"       <td>",
"        <p>",
"         History of asthma or cystic fibrosis",
"        </p>",
"        <p>",
"         Cough productive of phlegm with \"bronchial casts\"",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Eosinophilia",
"        </p>",
"        <p>",
"         IgE: &gt;1000 ng/mL",
"        </p>",
"        <p>",
"         Skin test: positive for aspergillus",
"        </p>",
"        <p>",
"         Aspergillus IgG: 2 fold elevation",
"        </p>",
"        <p>",
"         HRCT: mucous plugging, proximal bronchiectasis",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cardiac disease",
"       </td>",
"       <td>",
"        Crackles or wheezes",
"       </td>",
"       <td>",
"        <p>",
"         B type natriuretic peptide: elevated",
"        </p>",
"        <p>",
"         Chest xray: increased interstitial opacities, &plusmn;cardiomegaly",
"        </p>",
"        <p>",
"         Echocardiogram",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chronic eosinophilic pneumonitis",
"       </td>",
"       <td>",
"        <p>",
"         Asthma predates or develops in over 50 percent of patients",
"        </p>",
"        <p>",
"         Fever, weight loss, and night sweats are common",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Peripheral blood: &plusmn;eosinophilia",
"        </p>",
"        <p>",
"         Chest xray: bilateral peripheral opacities",
"        </p>",
"        <p>",
"         BAL: eosinophilia &gt;40 pecent",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Churg Strauss Syndrome",
"       </td>",
"       <td>",
"        <p>",
"         Cutaneous, neurologic, or other evidence vasculitis",
"        </p>",
"        <p>",
"         Paranasal sinus disease",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         ANCA: positive in 50 percent of patients",
"        </p>",
"        <p>",
"         Eosinophilia: &gt;10 percent",
"        </p>",
"        <p>",
"         Chest xray: patchy opacities",
"        </p>",
"        <p>",
"         Biopsy: granulomatous angiitis",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        COPD",
"       </td>",
"       <td>",
"        Smoking history",
"       </td>",
"       <td>",
"        PFTs: irreversible airflow obstruction and sometimes low DLCO",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        GERD",
"       </td>",
"       <td>",
"        May complain of chest tightness/restriction or nocturnal choking",
"       </td>",
"       <td>",
"        <p>",
"         Response to empiric treatment with PPI",
"        </p>",
"        <p>",
"         pH probe monitoring: acid reflux",
"        </p>",
"        <p>",
"         Spirometry normal, methacholine negative*",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Obstructive sleep apnea",
"       </td>",
"       <td>",
"        <p>",
"         Daytime hypersomnolence",
"        </p>",
"        <p>",
"         Nocturnal choking",
"        </p>",
"        <p>",
"         Snoring",
"        </p>",
"       </td>",
"       <td>",
"        Polysomnogram: elevated respiratory disturbance index",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tobacco smoke exposure",
"       </td>",
"       <td>",
"        History",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vocal cord dysfunction",
"       </td>",
"       <td>",
"        <p>",
"         Hoarseness/stridor (can be inspiratory and/or expiratory)",
"        </p>",
"        <p>",
"         Symptoms provoked by exercise",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Flow volume loop: slowing on inspiration",
"        </p>",
"        <p>",
"         Direct laryngoscopy (possibly during exercise or methacholine challenge): abnormal cord motion",
"        </p>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     ANCA: antineutrophil cytoplasmic antibodies; BAL: bronchoalveolar lavage; CTD: connective tissue disease; DLCO: diffusing capacity; GERD: gastroesophageal reflux disease; HRCT: high resolution computed tomography; PFTs: pulmonary function testing; PPI: proton pump inhibitor.",
"     <br>",
"      * GERD can also co-exist with asthma in which case methacholine challenge would be positive.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
