var title_f4_59_5055="Mgmt acute infusion rxns - I";
var content_f4_59_5055=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F85654&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=9\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F85654&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=9\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Administration of infliximab: Guidelines for drug administration and the recognition and initial approach to infusion reactions",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"3\" width=\"33%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"3\">",
"        Description",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td colspan=\"3\">",
"        Intravenous (IV) administration of infliximab, a tumor necrosis factor-&alpha; antagonist biologic therapy. Infliximab, a chimeric antibody, is administered in the form of periodic infusions (0, 2, and 6 weeks and, depending on the subsequent course of the disease, every 6 to 8 weeks thereafter).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Contraindications to treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        Known hypersensitivity to the drug or to murine proteins",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        Active systemic or localized infections",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        History of infection related to a prosthesis that remains in place",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        Infection with human immunodeficiency virus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        Active infection with hepatitis B virus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        Congestive heart failure classified on the New York Heart Association scale as functional class III/IV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        History of demyelinating disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        History of cancer (except when there has been no recurrence in the preceding 5 years and in the case of patients with basal cell carcinoma)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        Patients with a history of systemic lupus erythematosus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        Live vaccines should not be administered during treatment: yellow fever, German measles, measles, polio, or bacillus Calmette - Gu&eacute;rin (BCG)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"3\">",
"        Patient care during IV administration of infliximab",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Objectives",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        To prepare patients physically and psychologically so that they undergo treatment in the best possible conditions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        To ensure the patient's safety throughout the infusion process",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"indent1\" colspan=\"3\">",
"        To prevent treatment-related problems and ensure prompt detection of any such problems",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Preparation of the patient before the procedure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        Ascertain what the patient knows about the treatment they are about to receive",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        Patients may eat breakfast or lunch and take their usual medication unless they have a history of moderate to severe infusion reactions (risk of vomiting)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        Make the patient comfortable in a seat or bed, depending on the preference and physical state of each individual",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        Check whether the patient's chart includes an order for laboratory testing before the procedure, and whether premedication has been prescribed",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"indent1\" colspan=\"3\">",
"        Personnel: nursing staff",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Procedure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        Personnel: nursing staff",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"indent1\" colspan=\"3\">",
"        Materials:",
"        <br/>",
"        <ul>",
"         <li>",
"          Esmarch bandage",
"         </li>",
"         <li>",
"          Cotton",
"         </li>",
"         <li>",
"          Antiseptic",
"         </li>",
"         <li>",
"          20 G catheter",
"         </li>",
"         <li>",
"          Catheter securement dressings",
"         </li>",
"         <li>",
"          Pump",
"         </li>",
"         <li>",
"          Filter (pore size &le;1.2 &mu;)",
"         </li>",
"         <li>",
"          Infusion pump",
"         </li>",
"         <li>",
"          10 mL syringe",
"         </li>",
"         <li>",
"          21 G needle",
"         </li>",
"         <li>",
"          10 mL of double-distilled water for each vial of infliximab",
"         </li>",
"         <li>",
"          Infliximab (store in refrigerator at between 2&deg;C and 8&deg;C)",
"         </li>",
"         <li>",
"          250 mL of 0.9 percent saline solution",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Implement laboratory testing order, if any, prior to infusion. Administer prescribed premedication, if any. This can only be diphenhydramine or hydrocortisone.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        Check arterial blood pressure, heart rate, respiratory rate, and temperature at the start and after completion of infusion and whenever required by the patient's physical condition",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\" colspan=\"3\">",
"        Preparation of the drug",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\" colspan=\"3\">",
"        Aseptic technique",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\" colspan=\"3\">",
"        Reconstitute each 100 mg vial of infliximab with 10 mm of double-distilled water",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\" colspan=\"3\">",
"        Aim the double-distilled water against the side of the vial to prevent foaming",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\" colspan=\"3\">",
"        Ensure that the contents of the vial have dissolved completely, but avoid prolonged and energetic movements",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\" colspan=\"3\">",
"        Allow the solution to stand for 5 minutes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\" colspan=\"3\">",
"        The solution should be colorless to slightly yellowish and may contain translucent particles (protein)",
"        <br/>",
"        <ul>",
"         <li>",
"          The solution should not be administered if it is inappropriately colored or contains visible opaque particles",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\" colspan=\"3\">",
"        From the bottle of saline solution, withdraw a volume of saline equal to the volume of infliximab solution to be used in order to obtain a final volume of 250 mL and a concentration of between 0.4 and 4 mg/ml",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\" colspan=\"3\">",
"        The solution must be infused within 3 hours of reconstitution",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\" colspan=\"3\">",
"        Never dissolve infliximab in dextrose solution",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\" colspan=\"3\">",
"        Cannulate the venous line",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\" colspan=\"3\">",
"        Administer the drug using a volumetric infusion pump",
"        <br/>",
"        <ul>",
"         <li>",
"          The first, second, third, and fourth infusions should be administered over 2 hours (125 mL/hour)",
"         </li>",
"         <li>",
"          Starting with the fifth infusion, the dose can be infused in 1 hour (250 mL/hour)",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        Assess response to treatment; if the patient does not present any anomalous symptoms, he or she can be discharged and return to normal daily activity",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"indent1\" colspan=\"3\">",
"        Patients must be instructed to telephone their physician or the nursing staff if they experience any reaction symptoms after the infusion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Observations",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"indent1\" colspan=\"3\">",
"        Infusion time can be modified by the physician responsible for the patient",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Description of problems related to the procedure and remedial action",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        Acute infusion reactions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3\">",
"        Mild in the presence of",
"       </td>",
"       <td class=\"subtitle3\">",
"        Moderate in the presence of",
"       </td>",
"       <td class=\"subtitle3\">",
"        Severe in the presence of",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"sublist1\">",
"        <ul>",
"         <li>",
"          Headache",
"         </li>",
"         <li>",
"          Diaphoresis",
"         </li>",
"         <li>",
"          Throat irritation",
"         </li>",
"         <li>",
"          Lumbar pain",
"         </li>",
"         <li>",
"          Hyperemia",
"         </li>",
"         <li>",
"          Nausea",
"         </li>",
"         <li>",
"          Palpitations",
"         </li>",
"         <li>",
"          Itching",
"         </li>",
"         <li>",
"          Cutaneous eruption",
"         </li>",
"         <li>",
"          Flushing",
"         </li>",
"         <li>",
"          Vertigo",
"         </li>",
"         <li>",
"          Vomiting",
"         </li>",
"        </ul>",
"       </td>",
"       <td class=\"sublist1\">",
"        The same symptoms as mild reactions and",
"        <ul>",
"         <li>",
"          Dysphagia",
"         </li>",
"         <li>",
"          Hypotension or hypertension (&plusmn; 20 mmHg with respect to baseline)",
"         </li>",
"         <li>",
"          Chest pain or tightness",
"         </li>",
"         <li>",
"          Edema of the face, hands, or lips",
"         </li>",
"         <li>",
"          Suffocating sensation",
"         </li>",
"         <li>",
"          Hyperemia (accompanied by a sensation of heat or fever)",
"         </li>",
"         <li>",
"          Hyperthermia (&lt;39&deg;C)",
"         </li>",
"         <li>",
"          Palpitations, tachycardia",
"         </li>",
"         <li>",
"          Urticaria",
"         </li>",
"        </ul>",
"       </td>",
"       <td class=\"sublist1\">",
"        The same symptoms as moderate reactions and",
"        <ul>",
"         <li>",
"          Severe hypotension or hypertension (&plusmn; 40 mmHg with respect to baseline)",
"         </li>",
"         <li>",
"          Hyperthermia and chills (&ge;39&deg;C)",
"         </li>",
"         <li>",
"          Swelling of the larynx or pharynx with stridor",
"         </li>",
"         <li>",
"          Dyspnea",
"         </li>",
"         <li>",
"          Severe bronchospasm",
"         </li>",
"         <li>",
"          Convulsive seizure",
"         </li>",
"         <li>",
"          Clinically significant chest pain",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"3\">",
"        Action to be taken:",
"        <br/>",
"        <ul>",
"         <li>",
"          Stop the infusion",
"         </li>",
"         <li>",
"          Monitor blood pressure, heart rate, respiratory rate, and temperature",
"         </li>",
"         <li>",
"          Notify the treating physician",
"         </li>",
"         <li>",
"          If the reaction does not resolve, follow appropriate procedures for management of&nbsp;an acute reaction to infusion of infliximab",
"         </li>",
"         <li>",
"          If extravasation occurs, stop the infusion immediately, notify the treating physician, attempt to aspirate the extravasated fluid with a 10 to 20 mL syringe, withdraw the IV line, mark the affected area, and follow the hospital's treatment protocol covering such events",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"3\">",
"        Important points",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" colspan=\"3\">",
"        To ensure early detection of infusion reactions, monitor the patient's response to treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" colspan=\"3\">",
"        Ensure that the intravenous line is open",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"3\">",
"        Assessment indicators",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" colspan=\"3\">",
"        The nursing record should include details of the results of vital signs monitoring before and after treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" colspan=\"3\">",
"        The nursing record should provide details of the assessment of tolerance to treatment, that is, the occurrence or absence of incidents",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"3\">",
"        Records",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\" colspan=\"3\">",
"        The following information&nbsp;should be recorded:",
"        <br/>",
"        <ul>",
"         <li>",
"          Vital signs",
"         </li>",
"         <li>",
"          The assessment and preparation of the patient prior to treatment",
"         </li>",
"         <li>",
"          Incidents (presence or absence) related to the procedure",
"         </li>",
"         <li>",
"          Assessment of the patient's condition after treatment",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Original figure modified for this publication. Puig Sanz L, S&aacute;ez E, Lozano MJ, et al. [Reactions to infliximab infusions in dermatologic patients: consensus statement and treatment protocol. Working Group of the Grupo Espa&ntilde;ol de Psoriasis de la Academia Espa&ntilde;ola de Dermatolog&iacute;a y Venereolog&iacute;a ]. Actas Dermosifiliogr 2009; 100:103. Table used with the permission of Elsevier Inc. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
